import React from 'react';
import classes from './ToDoList.module.scss';
import ToDoItem from './ToDoItem';


const ToDoList = (props) => {
    const styles = {
        ul: {
            listStyle: 'none',
            margin: '10px',
            padding: 0,
            color: 'white',
            fontSize: '22px',
            fontWeight: 600,
            textAlign: 'center'
        }
    }
    return (
        <div className={classes.toDoWrapper}>
            <ul style={styles.ul}>
                {props.todos.map(todo => {
                    return <ToDoItem />
                })}
            </ul>
        </div>
    )

}



export default ToDoList;
